export const getMoviesList = async (movie) => {
    console.log(process.env.DB_HOST);
    console.log("https://imdb-api.com/API/Search/"+process.env.DB_HOST+"/" + movie);
  const response = await fetch(
    "https://imdb-api.com/API/Search/"+process.env.DB_HOST+"/" + movie
  );
  const movies = await response.json();
  const result = movies.results;
  return result;
};

export const getMovieID = async (ID) => {
  const response = await fetch(
    "https://imdb-api.com/en/API/Ratings/"+process.env.DB_HOST+"/" + ID
  );
  const movies = await response.json();
  console.log(movies)
};
